    public int maxProfit(int[] prices) {
        int max =0;
        for (int i=0;i<prices.length;i++){
            int tmpMax = 0;
            for (int j=i+1;j<prices.length;j++){
                if (prices[j]-prices[i]>tmpMax){
                    tmpMax = prices[j]-prices[i];
                }
            }
            if (tmpMax>max){
                max=tmpMax;
            }
        }
        return max;
    }
